{"title":"prueba_dvl","type":"vega","params":{"spec":"{
  $schema: https://vega.github.io/schema/vega-lite/v2.json
  data: {
    # URL object is a context-aware query to Elasticsearch
    url: {

      %context%: false
      index: repsol-av-workstation
      body: {
     "aggs": {
         "groups_by_month": {
           "terms": {
             field: "@timestamp",
             size: 12
           },
           "aggs": {
             "actualizados": {
               "filter": {
                 "term": {
                   "status_final": "Actualizado"
                 }
               }
             }
           }
         }
       }
      }
    }
    # We only need the content of hits.hits array
    format: {property: "aggregations.groups_by_month.buckets"}
  }
  # Parse timestamp into a javascript date value
  transform: [
              {calculate: "toDate(datum.key_as_string)", as: "time"}
              {calculate: "(datum.actualizados['doc_count']/datum.doc_count)*100" as: "actualizacion"}
             ],
  encoding: {
              x: {"timeUnit": "yearmonth", field: "time", type: "ordinal","axis": {"title": "Month of the year"}}
              y: {
                  aggregate: "sum", 
                  field: "actualizacion",
                  axis: {format: ".1f", title:"Percentage (%)", tickSize:1}
                  },
             "tooltip": [
                {field:"time", 
                 type:"ordinal",
                 title:"Mes"
                },   
                {"field": "actualizacion",
                 "type": "quantitative",
                 "format": ".2f",
                  title:"% de Actualización"}
                  ]
            },
  layer: [{
    "mark": "line"
  }, {
    "mark": {
      "type": "text",
      "align": "left",
      "baseline": "middle",
      "dy": -15
    },
    "encoding": {
